import React from "react";
import companyLogo from "../../assets/logo-search-grid-1x.png";
export default function logo() {
  return (
    <>
      <img  src={companyLogo} alt="BigCo Inc. logo" min-width={'100%'} max-width={'100%'}/>
    </>
  );
}
